package logic

import (
	"github.com/cherish-chat/xxim-server/app/gateway/internal/svc"
	"github.com/cherish-chat/xxim-server/common/pb"
	"github.com/zeromicro/go-zero/core/logx"
	"net/http"
	"strconv"
	"strings"
)

const svcTmpl = `<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="{{.TotalWidth}}" height="20" role="img" aria-label="xxim: {{.Count}} online"><title>xxim: {{.Count}} online</title><linearGradient id="s" x2="0" y2="100%"><stop offset="0" stop-color="#bbb" stop-opacity=".1"/><stop offset="1" stop-opacity=".1"/></linearGradient><clipPath id="r"><rect width="{{.TotalWidth}}" height="20" rx="3" fill="#fff"/></clipPath><g clip-path="url(#r)"><rect width="50" height="20" fill="#E23F5C"/><rect x="50" width="{{.RightWidth}}" height="20" fill="#FBC200"/><rect width="{{.TotalWidth}}" height="20" fill="url(#s)"/></g><g fill="#fff" text-anchor="middle" font-family="Verdana,Geneva,DejaVu Sans,sans-serif" text-rendering="geometricPrecision" font-size="110"><image x="5" y="3" width="14" height="14" xlink:href="data:image/png;base64,"/><text aria-hidden="true" x="335" y="150" fill="#010101" fill-opacity=".3" transform="scale(.1)" textLength="230">xxim</text><text x="335" y="140" transform="scale(.1)" fill="#fff" textLength="230">xxim</text><text aria-hidden="true" x="{{.textPosition}}" y="150" fill="#010101" fill-opacity=".3" transform="scale(.1)" textLength="{{.textLength}}">{{.Count}} online</text><text x="{{.textPosition}}" y="140" transform="scale(.1)" fill="#fff" textLength="{{.textLength}}">{{.Count}} online</text></g></svg>`

type ShieldLogic struct {
	r      *http.Request
	svcCtx *svc.ServiceContext
	logx.Logger
}

func NewShieldLogic(r *http.Request, svcCtx *svc.ServiceContext) *ShieldLogic {
	return &ShieldLogic{svcCtx: svcCtx, r: r, Logger: logx.WithContext(r.Context())}
}

func (l *ShieldLogic) Shield(convId string) (string, error) {
	ctx := l.r.Context()
	count, err := l.svcCtx.MsgService().GetConvOnlineCount(ctx, &pb.GetConvOnlineCountReq{
		ConvId: convId,
	})
	if err != nil {
		l.Errorf("GetConvOnlineCount failed, err: %v", err)
		return "", err
	}
	var totalWidth = 106
	var rightWidth = 56
	var textLength = 459
	var textPosition = 780
	deviceCount := strconv.Itoa(int(count.Device))
	totalWidth += (len(deviceCount) - 1) * 5
	rightWidth += (len(deviceCount) - 1) * 5
	textLength += (len(deviceCount) - 1) * 51
	textPosition += (len(deviceCount) - 1) * 25
	resp := strings.ReplaceAll(svcTmpl, "{{.Count}}", deviceCount)
	resp = strings.ReplaceAll(resp, "{{.TotalWidth}}", strconv.Itoa(totalWidth))
	resp = strings.ReplaceAll(resp, "{{.RightWidth}}", strconv.Itoa(rightWidth))
	resp = strings.ReplaceAll(resp, "{{.textLength}}", strconv.Itoa(textLength))
	resp = strings.ReplaceAll(resp, "{{.textPosition}}", strconv.Itoa(textPosition))
	return resp, nil
}
